import React, { useState } from 'react';
import axios from 'axios';

const Signup = () => {
  const [signupData, setSignupData] = useState({
    name: '',
    email: '',
    // Other signup fields
  });

  const handleSignup = () => {
    // Perform signup request to the backend
    axios.post('/api/signup', signupData)
      .then(response => {
        console.log('Signup successful!');
        
        // Fetch user profile details immediately after signup
        axios.get('/api/profile') // Adjust the endpoint according to your backend setup
          .then(profileResponse => {
            console.log('Profile details:', profileResponse.data);
            // Handle profile details, you may redirect to profile page or do other actions
          })
          .catch(profileError => {
            console.error('Error fetching profile:', profileError);
          });
      })
      .catch(error => {
        console.error('Signup error:', error);
      });
  };

  const handleChange = (e) => {
    setSignupData({
      ...signupData,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div>
      <h2>Signup</h2>
      <input type="text" name="name" placeholder="Name" onChange={handleChange} />
      <input type="email" name="email" placeholder="Email" onChange={handleChange} />
      {/* Other signup fields */}
      <button onClick={handleSignup}>Signup</button>
    </div>
  );
};

export default Signup;
